import '../../pages/register/style.css';
import { useState } from 'react';
import api from '../../services/api';



export default function Register() {

  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [specialization, setSpecialization] = useState('');
  const [password, setPassword] = useState('');
  const [crm, setCrm] = useState('');
  const [cpf, setCpf] = useState('');
  const [phoneOne, setPhoneOne] = useState('');
  const [phoneTwo, setPhoneTwo] = useState('');


  async function handleSubmit() {
    const data = {
      name: name,
      password: password,
      email: email,
      crm: crm,
      cpf: cpf,
      specialization: specialization,
      phoneOne: phoneOne,
      phoneTwo: phoneTwo
    }

    const response = await api.post('doctorSignUp', data);
    if(response.status === 201){
      alert('CADASTRADO COM SUCESSO! VERIFIQUE SEU E-MAIL')
    }else{
      alert('Erro ao cadastrar')
    }
    console.log(data);
  }

  return (
    <div>
      <Image source={require('image!egg')} style={styles.backgroundImage} />

      <h1>Cadastro</h1>


      <form>
        <div className="promotion-form__group">
          <label>Nome:</label>

          <input
            value={name}
            onChange={e => setName(e.target.value)}
            id="name" name="name" type="text" />
        </div>
        <br></br>
        <div className="promotion-form__group">
          <label>Senha:</label>
          <input
            value={password}
            onChange={e => setPassword(e.target.value)}
            id="password" name="password" type="password" />
        </div>
        <br></br>
        <div className="promotion-form__group">
          <label>Email:</label>
          <input

            value={email}
            onChange={e => setEmail(e.target.value)}
            id="email" name="email" type="text" />
        </div>
        <br></br>
        <div className="promotion-form__group">
          <label>Cpf:</label>
          <input
            value={cpf}
            onChange={e => setCpf(e.target.value)}
            email
            id="cpf" name="cpf" type="text" />
        </div>
        <br></br>
        <div className="promotion-form__group">
          <label>CRM:</label>
          <input
            value={crm}
            onChange={e => setCrm(e.target.value)}
            id="crm" name="crm" type="text" />
        </div>
        <br></br>
        <div className="promotion-form__group">
          <label>Especialização:</label>
          <input
            value={specialization}
            onChange={e => setSpecialization(e.target.value)}
            id="specialization" name="specialization" type="text" />
        </div>
        <br></br>
        <div className="promotion-form__group">
          <label>Telefone1:</label>
          <input
            value={phoneOne}
            onChange={e => setPhoneOne(e.target.value)}
            id="phoneOne" name="phoneOne" type="text" />
        </div>
        <br></br>
        <div className="promotion-form__group">
          <label>Telefone2:</label>
          <input
            value={phoneTwo}
            onChange={e => setPhoneTwo(e.target.value)}
            id="phoneTwo" name="phoneTwo" type="text" />
        </div>
      </form>
      <br></br>
      <button type="submit" color="success" onClick={handleSubmit}>Cadastrar</button>
    </div>
  );
}
